import TrendCard from '../components/TrendCard';

function ScamTrends() {
  const trends = [
    { title: 'üö® Instagram Crypto Flipping Scam', date: 'Mar 20, 2025', description: 'Fake accounts promising huge returns.' },
    { title: 'üè¶ Fake Bank Safe Account Scam', date: 'Mar 15, 2025', description: 'Calls asking to move money for ‚Äúsafety‚Äù.' },
    { title: 'üéÅ Vinted Buyer Asking to Pay via Transfer', date: 'Mar 10, 2025', description: 'Buyers avoiding platform payments.' },
  ];

  return (
    <div className="pt-20 pb-10 max-w-5xl mx-auto px-4">
      <h1 className="text-3xl font-bold text-gray-800">Scam Trends</h1>
      <div className="mt-6 grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
        {trends.map((trend) => (
          <TrendCard key={trend.title} {...trend} />
        ))}
      </div>
    </div>
  );
}

export default ScamTrends;
